import React, { useState, useEffect } from 'react';
import Loading from '../components/UI/loading/loading';
import Pointer from '../components/UI/pointer/pointer';
import connection from './components/connection';

function Card({ cardid, loading }) {

  const [innerData, setInnerData] = useState([]);

  useEffect(async (cardData) => {
      try {
      loading(true);
      const res = await connection.get('/', cardid);
      setInnerData(res.data);
    } catch (e) {
      console.log(`An error occured1: ${e}`);
    } finally {
      loading(false);
    }
  })


    return <div className='innercard'>
    </div>
}

export default Card;
